import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import {
    Container,
    Row,
    Col
} from 'react-bootstrap';
import uw from './images/W.png';

function UW() {
    return(
        <div className='App-header'>
            <Container fluid>
                <Row className='Teamhead'>
                    <img width='150' height='100' src={uw} style={{marginBottom: '0.5rem'}} style={{ marginRight: '10px', marginBottom: '8px' }}></img>
                    Washington Husky Men's Basketball Team
                </Row>
                <Row>
                    <Col xl={2} className="Teams">

                        
                    </Col>
                    <Col xl={8}>
                        
                    </Col>
                    <Col xl={2} className="Friends">3</Col>
                </Row>
            </Container>
        </div>
    );
}

export default UW;
